import React, { Component } from 'react';
import axios from "axios";

class LandingPage extends Component {
  constructor(props){
    super(props);
    this.state={
      posts:[]
    }
  }
componentDidMount(){
  this.getPosts();
}

  getPosts(){
    Axios.get("http://localhost:5000/posts").then( (res) => {
      if(res.data.success){
        this.setState({
          posts:res.data.posts,
        });
        console.log(this.state.posts);
      }
    });
  };
  render() {
    return (

      <div className="container">
        <p>ALL CARS</p>
        {/*this.state.posts.map(post => (<div>
          <p>{post.bikeName}</p>
          <p>{post.bikeType}</p>
          <p>{post.rentPrice}</p>
          </div>
        ))*/}
        <table class="table">
  <thead>
    <tr>
      <th scope="col">$</th>
      <th scope="col">bikeName</th>
      <th scope="col">bikeType</th>
      <th scope="col">rentPrice</th>
      <th scope="col">action</th>
    </tr>
  </thead>
  <tbody>
  {this.state.posts.map((post, index ) => (
    <tr>
      <th scope="row">{index}</th>
      <td>{post.bikeName}</td>
      <td>{post.bikeType}</td>
      <td>{post.rentPrice}</td>
      <td>
        <a className="btn btn-warning" href="#">
          <i className="fas fa-edit"></i>Edit
        </a>
        &nbsp;
        <a className="btn btn-danger" href="#">
          <i className="far fa-times-circle"></i>Delete
        </a>
      </td>
    </tr>
    ))}
  </tbody>
</table>
<button className="btn btn-success"><a href="/add">Add new car</a> </button>
      </div>
    )
  }
}

export default LandingPage;
